						var sustainVis = new flixel_FlxSprite(note.x + this.GRID_SIZE / 2,note.y + this.GRID_SIZE).makeGraphic(8,Math.floor(this.getYfromStrum(note.strumTime + note.sustainLength) * this.zoomFactor - note.y));
